import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchEmployeeAccess, selectEmployeeAccess } from '../redux/slices/employeeAccess';
import { CircularProgress, Typography } from '@mui/material';

const EmployeeAccess = () => {
    const dispatch = useDispatch();
    const employeeAccess = useSelector(selectEmployeeAccess);
    const isLoading = useSelector(state => state.employeeAccess.isLoading);

    useEffect(() => {
        dispatch(fetchEmployeeAccess());
    }, [dispatch]);

    if (isLoading) {
        return <CircularProgress />;
    }

    return (
        <div>
            <Typography variant="h4">Employee Access Page</Typography>
            {/* Здесь вы можете отображать данные о доступе сотрудников */}
            {/* Например, можно использовать employeeAccessData */}
        </div>
    );
};

export default EmployeeAccess;
